import React from 'react' /* links de importação */
import styled from 'styled-components'

const Container = styled.div` /*Container lista de navegaçção */
    width: 100%;
    height: 10%;
    background-color: ${(props) => props.theme.colors.bgDefault};
    display: flex;
    justify-content: space-between;
    align-items: center;
`

const Logo = styled.h1` 
    font-size: 20px;
    text-decoration: underline;
    color: ${(props) => props.theme.colors.primary};
    cursor: pointer;
`

const Left = styled.div`
  display: flex;
  background-color: ${(props) => props.theme.colors.bgDefault};
  justify-content: space-around;
  flex: 1;
  align-items: center;
`
const Center = styled.div`
display: flex;
  flex: 2;
`
const Right = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: space-around;
`

const Menu = styled.ul`
    display: flex;
    list-style: none;
`
const MenuItem = styled.li`
    font-size: 20px;
    font-weight: bold;
    margin-right: 30px;
    color: ${(props) => props.theme.colors.textDark};
    cursor: pointer;
    &:hover {
        color: ${(props) => props.theme.colors.primary};
    }
`

const Button = styled.button`
    font-weight: bold;
    background-color:  ${(props) => props.theme.colors.primary};
    border: 2px solid white;
    cursor: pointer;
    color:  ${(props) => props.theme.colors.bgDefault};
    padding: 10px 20px;
    border-radius: 10px;
    &:hover {
        background-color: ${(props) => props.theme.colors.primary};
        color:  ${(props) => props.theme.colors.bgLight};
        border: 2px solid darkblue;
    }
`

const Navbar = () => {
  return (
    <Container>
      <Left><Logo>IT Support</Logo></Left>
      <Center><Menu>
        <MenuItem>Home</MenuItem>
        <MenuItem>About us</MenuItem>
        <MenuItem>Services</MenuItem>
        <MenuItem>Contact</MenuItem>
        <MenuItem>Blog</MenuItem>
        </Menu></Center>
      <Right><Button>call us Now!</Button></Right>
    </Container>
  )
}

export default Navbar
